import React from "react";
import ForecastWeatherCard from "./ForecastWeatherCard";

const ForecastWeather = ({ data }) => {
  if (data && data.daily) {
    console.log(data.daily[1]);
  }
  return (
    <div>
        {data.daily &&
      (
      <>
      <ForecastWeatherCard data={data.daily[1] } />
      <ForecastWeatherCard data={data.daily[2] } />
      <ForecastWeatherCard data={data.daily[3] } />
      <ForecastWeatherCard data={data.daily[4] } />
      <ForecastWeatherCard data={data.daily[5] } />
      <ForecastWeatherCard data={data.daily[6] } />
      <ForecastWeatherCard data={data.daily[7] } />
      </>
      )
      }
    </div>
  );
};

export default ForecastWeather;
